import React, { useEffect, useSate } from "react";

const FetchData = url => {
  const [state, setState] = useSate({ state: null, loading: true });

  useEffect(() => {
    fetch(url)
      .then(x => x.text())
      .then(y => console.log(y));
  }, [url]);
};

export default FetchData;
